function get_value_from_nested_lang_object(e){return e.split(".").reduce((e,t)=>e?e[t]:null,ua_lang_obj)}function translate_page_to_ua(){document.querySelector(".ua_switcher").classList.add("disabled");for(const e of document.querySelectorAll(".lang"))e.textContent=get_value_from_nested_lang_object(e.attributes.key.nodeValue)}import{ua_lang_obj}from"./translation_into_ua.min.js";let switcher_class;if(console.log("switch_language.min.js is loaded"),"ua"==localStorage.getItem("language")||"ua"==search_params.get("language"))translate_page_to_ua(),switcher_class="en";else{switcher_class="ua";const e=document.querySelector(".en_switcher");e.classList.add("disabled")}const switch_language_btn=document.querySelector(`.${switcher_class}_switcher`);switch_language_btn.addEventListener("click",function(){"ua"==localStorage.getItem("language")?localStorage.setItem("language","en"):localStorage.setItem("language","ua"),window.history.replaceState(null,null,window.location.pathname),location.reload()});